const Join_css=()=>{
    return(
        <style global jsx>{`

        .signin-card {
          padding: 40px;
          width: 274px;
          background-color: #fff;
          margin: 0 auto 10px;
          border-radius: 2px;
          overflow: hidden;
        }

        .signin-card h1 {
          font-weight: 100;
          text-align: center;
          font-size: 2.3em;
        }
        .signin-username{
          margin: 0px auto;
          /* padding: 50px 0px 0px 0px; */
        }
        .signin-name > input {
          display: block;
          font-size: 16px;
          /* margin: 0px auto; */
          margin-bottom: 10px;
          background: #fff;
          width: 270px;
          height: 35px;
          border: 1px solid #d9d9d9;
          border-top: 1px solid #c0c0c0;
          border-width: 0px 0px 3px 0px;
          border-style: solid;
          box-sizing: border-box;
          padding: 0 8px;
          box-shadow: 0 2px 5px #0000007c inset;
        }

        .signin-username > input {
          display: block;
          font-size: 16px;
          /* margin: 0px auto; */
          margin-bottom: 10px;
          background: #fff;
          width: 270px;
          height: 35px;
          border: 1px solid #d9d9d9;
          border-top: 1px solid #c0c0c0;
          border-width: 0px 0px 3px 0px;
          border-style: solid;
          box-sizing: border-box;
          padding: 0 8px;
          box-shadow: 0 2px 5px #0000007c inset;
        }
        .signin-pwd > input {
          display: block;
          font-size: 16px;
          /* margin: 0px auto; */
          margin-bottom: 10px;
          background: #fff;
          width: 270px;
          height: 35px;
          border: 1px solid #d9d9d9;
          border-top: 1px solid #c0c0c0;
          border-width: 0px 0px 3px 0px;
          border-style: solid;
          box-sizing: border-box;
          padding: 0 8px;
          box-shadow: 0 2px 5px #0000007c inset;
        }
        .ph > input {
          display: block;
          font-size: 16px;
          /* margin: 0px auto; */
          margin-bottom: 10px;
          background: #fff;
          width: 270px;
          height: 35px;
          border: 1px solid #d9d9d9;
          border-top: 1px solid #c0c0c0;
          border-width: 0px 0px 3px 0px;
          border-style: solid;
          box-sizing: border-box;
          padding: 0 8px;
          box-shadow: 0 2px 5px #0000007c inset;
        }
        .birth > input {
          display: block;
          font-size: 16px;
          /* margin: 0px auto; */
          margin-bottom: 10px;
          background: #fff;
          width: 270px;
          height: 35px;
          border: 1px solid #d9d9d9;
          border-top: 1px solid #c0c0c0;
          border-width: 0px 0px 3px 0px;
          border-style: solid;
          box-sizing: border-box;
          padding: 0 8px;
          box-shadow: 0 2px 5px #0000007c inset;
        }
        .signin-card input[type=submit] {
          width: 50%;
          display: block;
          margin-bottom: 10px;
          position: relative;
          float: right;
        }
        .sign_in {
          float: right;
          text-align: center;
          font-size: 14px;
          font-weight: 700;
          margin-top: 20px;
          height: 32px;
          padding: 0 8px;
          background-color: #343B40;
          color: #E6BEBE;
        }
        .signin-back{
          background-color: #F4C2C2;
          height: 100%;
          text-align: center;
        }
        .signin-whiteback {
          margin: 0 auto 10px;
          background-color: white;
          height: 500px;
          width: 700px;
        }

        
        `}</style>
    )

}
export default Join_css
